import styled from 'styled-components';

export const Foos = styled.footer`

	background: $appleBlue;
	padding: 0.5rem 1rem;
	display: grid;
	color: $appleDWhite;
	position: relative;
	margin-bottom: 0;

.copyright{
	text-align: center;
}
`;
